                    { 8, new[] { "Оказываем услуги по ремонту в городах Кавказских Минеральных Вод (Минеральные Воды, Пятигорск, Ессентуки, Кисловодск) и в прилегающих носеленных пунктах." }, false, false, false, true, false, 1, null },
